import "./Signup.css";
import React from "react";
import { useEffect, useState } from "react";
import Axios from "axios";

function Signup() {
    var x = document.getElementById("login");
    var y = document.getElementById("signup");
    var z = document.getElementById("btn");

    const signup = () => {
        x.style.left = "-400px";
        y.style.left = "50px";
        z.style.left = "110px";
    };
    const login = ()=> {
        x.style.left = "50px";
        y.style.left = "450px";
        z.style.left = "0px";
     };
    return(
        <div className = "page">
            <div className="layer">
            <div class = "box">
                <div className="button-box">
                    <div id="btn">
                    <button type="button" class="toggle-btn" onclick="login()">Log In</button>
                    <button type="button" class="toggle-btn" onclick="signup()">Sign Up</button>
                     </div>
                </div>
                <form id="login" className="input-group">
                    <input type="text" className ="input-field" placeholder="Enrollment Number" required/>
                    <input type="password" className ="input-field" placeholder="Password" required/>
                    <input type="checkbox" className="check-box"/><span>Remember Password</span>
                    <button type="submit" className="submit-btn">Log In</button>
                </form>
                <form id="signup" className="input-group">
                    <input type="text" className ="input-field" placeholder="Enrollment Number" required/>
                    <input type="password" className ="input-field" placeholder="Set a Password" required/>
                    <input type="number" className ="input-field" placeholder="Contact Number" required/>

                    <select name="Fresher/Senior" required>
                        <option value="">Fresher/Senior</option>
                        <option value="Fresher">Fresher</option>
                        <option value="Senior">Senior</option>
                    </select>
                    <button type="submit" class="submit-btn">Sign Up</button>
                </form>
            </div>

        </div>
    </div>
    );
}
export default Signup;
